import React from "react";
import {ContainerNav, ImageNav} from "./carrosselStyle";
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.css';

export default function AppMain() {
    const SimpleSwiper = () => {
        return (
          <Swiper spaceBetween={50} slidesPerView={1}>
            <SwiperSlide>
              <ImageNav></ImageNav>
            </SwiperSlide>
            <SwiperSlide>
              <div>Slide 2</div>
            </SwiperSlide>
            <SwiperSlide>
              <div>Slide 3</div>
            </SwiperSlide>
          </Swiper>
        );
      };

    const PaginatedSwiper = () => {
        return (
          <Swiper
            spaceBetween={50}
            slidesPerView={1}
            navigation
            pagination={{ clickable: true }}
            modules={[Navigation, Pagination]}
          >
            <SwiperSlide>
              <div>Slide 1</div>
            </SwiperSlide>
            <SwiperSlide>
              <div>Slide 2</div>
            </SwiperSlide>
            <SwiperSlide>
              <div>Slide 3</div>
            </SwiperSlide>
          </Swiper>
        );
      };
    return (
        <SimpleSwiper></SimpleSwiper>
    );
}

import { Navigation, Pagination } from 'swiper';
import 'swiper/swiper-bundle.css';
